<?php

require_once("database.php");
require_once('../Article.php');

session_start();

//Retrieves data from article form and stores it in variables 
$category = $_POST['category'];
$title = $_POST['title'];
$date = $_POST['date'];
$text = $_POST['text'];
$commentsEnabled = $_POST['comments'];
$tags = $_POST['tags'];

//if header image isn't set, sets it based on category
if ($_FILES['headerimage']['size'] > 0) {
    $file_location = $_FILES['headerimage']['tmp_name'];
    $file_data = file_get_contents($file_location);
    $headerimage = base64_encode($file_data);
} else if ($category == 'World News') {
    $headerimage = '';
} else if ($category == 'Local News') {
    $headerimage = '';
} else if ($category == 'Politics') {
    $headerimage = '';
} else if ($category == 'Sport') {
    $headerimage = '';
} else if ($category == 'Entertainment') {
    $headerimage = '';
}
else if($category == 'Technology') {
    $headerimage = '';
}

//Instansiates new Article object
$article = new Article($_SESSION['userid'], $_SESSION['username'], $title, $category, $text, $date, $commentsEnabled, $tags);

//Sets length of article text displayed on home page
$displaytext = substr($text, 0, 140);

$query = "INSERT INTO article(userid,username,title, category, text, displaytext, date, comments, tags, headerimage) VALUES(:userid,:username,:title, :cat, :text, :displaytext, :date, :comments, :tags, :headerimage)";
$statement = $db->prepare($query);
$statement->bindValue(":userid", $article->userid);
$statement->bindValue(":username", $article->username);
$statement->bindValue(":title", $article->title);
$statement->bindValue(":cat", $article->category);
$statement->bindValue(":text", $article->text);
$statement->bindValue(":displaytext", $displaytext);
$statement->bindValue(":date", $article->date);
$statement->bindValue(":comments", $article->comments);
$statement->bindValue(":headerimage", $headerimage);
$statement->bindValue(":tags", $tags);

try {
    $statement->execute();
} catch (Exception $ex) {
    echo $ex;
    exit();
}
$statement->closeCursor();

$articleList = array();
array_push($articleList, $article);

header('location:../home.php');
